window.bookSummaryJSON = "<p><b>I may be blind, but they won’t see me coming.</b></p> <p>Cassius. Victor. Torsten.</p> <p>My monster. My strength. My heart.</p> <p>Three cruel, broken kings who kissed me with poison</p> <p>And woke me from my slumber.</p> <p>I used to think that my future lay beyond ivy-covered walls;</p> <p>College, a career, a white-picket fence…</p> <p>But now I’m bathed in blood and fire.</p> <p>Now I wear their thorny crown,</p> <p>and sit upon a throne of skulls.</p> <p>I fight for a different future – a brutal, beautiful new world.</p> <p>I’ll burn the world for them, for us, for our family,</p> <p>even if it means paying the ultimate price.</p> <p><i>Illis quos amo deserviam.</i></p> <p>For those I love, I sacrifice.</p> <p><i>Poison Kiss is a new adult, dark contemporary romance with three hot guys and one girl. It is intended for 18+ listeners.</i></p>"; 
